import React, { Component } from "react";
import TodoItem from "../TodoItem/TodoItem";

class TodoList extends Component {
	render(){
		const {todoList} = this.props;
		console.log(this.props);

		const list = todoList.map(
			todo => (
				<TodoItem
					idx={todo.idx}
					flag={todo.flag}>
					{todo.msg}
				</TodoItem>
			)
		)

		return(
			<div>
				{list}
			</div>
		)
	}
}

export default TodoList;
